import './App.css';

import { React  } from 'react';

function App() {

  return (

        <Routes>

        <Route path="/" element={<Login/>}/>
        <Route path="/main" element={<Home/>}/>
        <Route path="/write" element={<Write/>} />
        <Route path="/signup" element={<Signup/>} />

      </Routes>
  );
}

export default App;
